// CardView.js
import React from "react";
import Card from "./Card";
import "./CardView.css";

function CardView(props) {
  const card = props.cards.filter((item) => item.id == 2);
  console.log(card);

  const newcarddata = (data) => {
    let count = data.count;
    let newcard = [];
    for (let i = 0; i < count; i++) {
      newcard.push({
        id: i + 1,
        volume: data.volume[i],
        Rupee: data.Rupee[i],
      });
    }
    return newcard;
  };

  const newcard = newcarddata(card);
  console.log(newcard);

  return (
    <div className="card-view">
      {(Card) => (
        <Card key={card.id} volume={card.volume[1]} Rupee={card.Rupee} />
      )}
    </div>
  );
}

export default CardView;
